import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ClienteService } from 'src/app/services/cliente.service';

@Component({
  selector: 'app-recarga',
  templateUrl: './recarga.component.html',
  styleUrls: ['./recarga.component.css']
})
export class RecargaComponent {
  loginForm: FormGroup;

  constructor(private formBuilder: FormBuilder, private clienteService: ClienteService) { // Inyecta Router aquí
    this.loginForm = this.formBuilder.group({
      dni: ['', [Validators.required, Validators.minLength(10)]], 
      monto: [1, [Validators.required, Validators.min(1)]]
    });
  }

  onSubmit() {
    if (this.loginForm.valid) {
      const dni = this.loginForm.value.dni;
      const monto = this.loginForm.value.monto;
      // Realizar la llamada al servicio y suscribirse para manejar la respuesta
      this.clienteService.gettransferenciaRecarga(dni, monto).subscribe(
        response => {
          console.log('Transferencia existosa', response);
          alert('Transferencia exitosa')
        },
        error => {
          console.error('Error en la transferencia', error);
          // Manejar aquí el error, por ejemplo, mostrando un mensaje al usuario
        }
      );
    }
  }

}
<div>
  <label for="id">ID:</label>
  <input type="text" id="id" name="id" [(ngModel)]="usuario.id"><br><br>

  <label for="username">Username:</label>
  <input type="text" id="username" name="username" [(ngModel)]="usuario.username"><br><br>

  <label for="firstName">First Name:</label>
  <input type="text" id="firstName" name="firstName" [(ngModel)]="usuario.firstName"><br><br>

  <label for="lastName">Last Name:</label>
  <input type="text" id="lastName" name="lastName" [(ngModel)]="usuario.lastName"><br><br>

  <label for="email">Email:</label>
  <input type="text" id="email" name="email" [(ngModel)]="usuario.email"><br><br>

  <label for="password">Password:</label>
  <input type="password" id="password" name="password" [(ngModel)]="usuario.password"><br><br>

  <label for="phone">Phone:</label>
  <input type="text" id="phone" name="phone" [(ngModel)]="usuario.phone"><br><br>

  <label for="userStatus">User Status:</label>
  <input type="number" id="userStatus" name="userStatus" [(ngModel)]="usuario.userStatus"><br><br>

  <button (click)="enviarUsuario()">Enviar Usuario</button>
</div>
